const FormSidebarMenu = () => {
	return (
		<div className="topbar-menu">
			<ul>
				<li>Add</li>
				<li>Edit</li>
				<li>Delete</li>
				<li>Update</li>
				<li>Search</li>
				<li>Close</li>
			</ul>
		</div>
	);
};

export default FormSidebarMenu;
